    <div className="line-placeholder"></div>
    <div className="line-placeholder"></div>
    <div className="line-placeholder"></div>
    <div className="line-placeholder"></div>
    <div className="line-placeholder"></div>
    <div className="line-placeholder"></div>
  </div>
);

export default CardPlaceholder;
